import React from "react";
import { Bar } from "react-chartjs-2";

const TestA = (props) => {
  const entries = props.filteredEntries;

  //   totalAttendeeCount = filteredEntries
  //   .map((entry) => entry.attendee_count)
  //   .reduce((accumulator, runningTotal) => accumulator + runningTotal);
  // }

  const times = entries.map((entry) => entry.time.slice(0, 4));
  const counts = entries.map((entry) => entry.attendee_count);

  let total = 0;
  for (let i = 0; i < times.length; i++) {
    if (times.filter((each) => each === times[i]).length > 1) {
      total += counts[i];
      console.log(total);
    }
    yD.push(total)
  }

  const xD = [...new Set(times)];
  const yD = counts
  const combinedA = [];
  for (let i = 0; i < entries.length; i++) {
    combinedA.push({ x: `${xD[i]}0`, y: yD[i] });
  }

  const earliestHour = parseInt(xD[0]);
  const latestHour = parseInt(xD[xD.length - 1]) + 1;

  const timeSpacedA = [];
  for (let j = earliestHour; j < latestHour; j++) {
    for (let i = 0; i < 6; i++) {
      if (j < 10) {
        timeSpacedA.push(`0${j}:${i}0`);
      } else {
        timeSpacedA.push(`${j}:${i}0`);
      }
    }
  }

  function barValue(x) {
    for (let each of combinedA) {
      if (x === each.x) {
        return each.y;
      }
    }
    return 0;
  }

  console.log(combinedA);

  return (
    <div>
      <Bar
        type="bar"
        data={{
          labels: timeSpacedA.map((v) => v),
          datasets: [
            {
              backgroundColor: "#000",
              borderWidth: 2,
              fill: false,
              data: timeSpacedA.map((v) => barValue(v)),
            },
          ],
        }}
        options={{
          responsive: true,
          legend: {
            display: false,
          },
          scales: {
            xAxes: [
              {
                display: true,
                ticks: {
                  maxTicksLimit: latestHour - earliestHour,
                },
              },
            ],
            yAxes: [
              {
                display: true,
                type: "linear",
              },
            ],
          },
        }}
      />
    </div>
  );
};

export default TestA;
